function Description() {
  return (
    <div className="App">
        <h1 class="heading" > Family Description </h1>
        <p class="p" >
            This page provides some family descriptions to make Protein Annotation accessible to non-experts.
        </p>

        <li class="question" > Family Accession: PF13649.6 </li>
        <li class="answer" > TBW. </li>

        <li class="question" > Family Accession: PF12746.7 </li>
        <li class="answer" > TBW. </li>

        <li class="question" > Family Accession: PF03587.14 </li>
        <li class="answer" > TBW.</li>

        <li class="question" > Family Accession: PF01967.21</li>
        <li class="answer" > TBW. </li>
    </div>
  );
}

export default Description;
